import React, { Component } from "react";

const Like = () => {
  let classes = "fa fa-heart";
  if (!this.props.liked) classes += "-o";
  return (
    <i
      style={{ cursor: "pointer" }}
      onClick={this.props.onToggleLike}
      className={classes}
      aria-hidden="true"
    />
  );
};

export default Like;
